import React from "react";
import Box from "./Box";
import "../App.css";
const WaterVending = () => {
  const IdType = {
    id: "A1",
    Type: "white",
  };
  return (
    <span className="WaterVending">
      <Box IdType={IdType} />
      <Box IdType={IdType} />
      <Box IdType={IdType} />
      <Box IdType={IdType} />
      <Box IdType={IdType} />
      <Box IdType={IdType} />
    </span>
  );
};
export default WaterVending;
